// src/App.js (TEMPORARY DEBUGGING VERSION FOR MODELINSIGHTS)

import React, { useState } from 'react';
import { BrowserRouter, useNavigate, Routes, Route } from 'react-router-dom';
import { BrainCircuit, GitCompareArrows, X } from 'lucide-react';

// ===================================================================
// COMPONENT 1: The Modal (Dependency for ModelInsights)
// ===================================================================
function Modal({ isOpen, onClose, title, children }) {
  if (!isOpen) return null;
  return (
    <div className="fixed inset-0 bg-black bg-opacity-75 flex justify-center items-center z-50" onClick={onClose}>
      <div className="bg-gray-800 rounded-lg shadow-2xl p-6 border border-gray-700 w-11/12 max-w-4xl" onClick={e => e.stopPropagation()}>
        <div className="flex justify-between items-center border-b border-gray-600 pb-3 mb-4">
          <h2 className="text-2xl font-semibold text-cyan-400">{title}</h2>
          <button onClick={onClose} className="text-gray-400 hover:text-white p-1 rounded-full hover:bg-gray-700">
            <X size={24} />
          </button>
        </div>
        <div className="text-gray-300">{children}</div>
      </div>
    </div>
  );
}

// ===================================================================
// COMPONENT 2: ModelInsights (The component we are testing)
// ===================================================================
function ModelInsights() {
  const navigate = useNavigate(); // This hook requires a Router context to work
  const [isCompareModalOpen, setIsCompareModalOpen] = useState(false);

  return (
    <>
      <div className="bg-gray-800 p-6 rounded-lg shadow-lg border border-gray-700">
        <h2 className="text-2xl font-semibold mb-4 border-b border-gray-600 pb-3">Model Insights</h2>
        <div className="space-y-4">
          <button 
            onClick={() => navigate('/performance')} 
            className="w-full flex items-center justify-center space-x-3 bg-gray-700 text-gray-300 font-medium py-3 px-4 rounded-lg hover:bg-gray-600 transition-all duration-200">
            <BrainCircuit size={20} />
            <span>View Training Performance</span>
          </button>
          <button 
            onClick={() => setIsCompareModalOpen(true)} 
            className="w-full flex items-center justify-center space-x-3 bg-gray-700 text-gray-300 font-medium py-3 px-4 rounded-lg hover:bg-gray-600 transition-all duration-200">
            <GitCompareArrows size={20} />
            <span>Compare v7 vs v8 Results</span>
          </button>
        </div>
      </div>
      <Modal isOpen={isCompareModalOpen} onClose={() => setIsCompareModalOpen(false)} title="YOLOv7 vs YOLOv8 Comparison">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <img src="/images/yolov7_results.png" alt="YOLOv7" />
          <img src="/images/yolov8_results.png" alt="YOLOv8" />
        </div>
      </Modal>
    </>
  );
}

// ===================================================================
// COMPONENT 3: A dummy Dashboard to host ModelInsights
// ===================================================================
function DashboardPage() {
    return (
        <div className="bg-gray-900 min-h-screen p-8">
            <h1 className="text-white text-3xl mb-4">Dashboard Test Page</h1>
            <div className="max-w-md">
                 <ModelInsights />
            </div>
        </div>
    );
}

// Dummy Performance Page for the router
function PerformancePage() {
    return <h1 className="text-white text-3xl p-8">Welcome to the Performance Page!</h1>
}


// ===================================================================
// MAIN APP COMPONENT (The Router)
// ===================================================================
export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* For this test, we'll show the dashboard at the main URL */}
        <Route path="/" element={<DashboardPage />} /> 
        <Route path="/performance" element={<PerformancePage />} />
      </Routes>
    </BrowserRouter>
  );
}
